import React from 'react';

const ProductTitle = (props) =>{
	return(
		<div class="row productTitle">
			<div class="col-12 col-md-6">
				<h1>{props.name}</h1>
				<p class="packInfo">{props.power} "//" Packet of {props.quantity}</p>
			</div>
		</div>
	)
};
export default ProductTitle;
